      SELECT DISTINCT col2 * + 6 * col0 - - col0 + ( ( - col1 ) ) + + 90 - + 9 * + col0 * 86 AS col2 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
